import React from "react";
import { Item } from "./styled";
import { Link } from "react-router-dom";
export default (props) => {
  return (
    <div>
      <Item className="adItem">
        <Link to={`/ad/${props.data.id}`}></Link>
      </Item>
    </div>
  );
};
